typedef struct Mouse
{
    int x;
    int y;
    int fdMouse;
} Mouse;

typedef struct Player
{
    // TODO Sprites
    int HP;
    int bombs;
    int power;
    int posX;
    int posY;
    int bombID;
} Player;

typedef struct Item
{
    int HP;
    int powerBoost;
    int increaseBombs;
    int speedBoost;
    int HPBoost;
} Item;

typedef struct Block
{
    int HP;
    Item item;
} Block;

typedef struct Bomb
{
    int timer;
    int power;
    Player *owner;
} Bomb;

typedef union Object
{
    Block block;
    Item item;
    Player player;
    Bomb bomb;
} Object;

typedef struct Cell
{
    int type;
    Object object;
} Cell;

typedef struct Map
{
    Cell matriz[MAP_SIZE][MAP_SIZE];
    int x;
    int y;

} Map;

